import React, { useState, useEffect } from 'react';
import './App.css';
import axios from "axios";

import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Home from './components/Home';
import Navbar from './components/Navbar';
import Signup from './components/Signup';
import LogIn from './components/LogIn';
import Course from './components/Course ';
import CategoryCourses from './components/Category_courses';

const App = () => {
	return (
		<Router>
			<Navbar />
			<Switch>
				<Route exact path='/' render={(props) => <Home  {...props} />} />
				<Route path='/join/login' render={(props) => <LogIn  {...props} />} />
				<Route path='/join/signup' render={(props) => <LogIn  {...props} />} />
				<Route path='/courses/:id' render={(props) => <CategoryCourses  {...props} />} />
				<Route path='/course/:id' render={(props) => <Course  {...props} />} />
			</Switch>
		</Router>
	);
};

export default App;
